import Button from 'react-bootstrap/Button';
import '../Styles/index.css'
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useState } from 'react';
import { createContext } from 'react';
import { NavLink } from 'react-router-dom';

function Header() {
  // const [img, setImg] = useState("");
  // const inputEvent = (event) => {
  //   const data = event.target.value;
  //   setImg(data);
  // }
  
  // const con = createContext();
  // <con.Provider>
  // </con.Provider>

  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="#">fukatkhau.com</Navbar.Brand>
        <Navbar.Toggle />
        <Navbar.Collapse id="navbarScroll" className='bg-body-tertiary'>
          <div></div>
          <Nav
            className="mx-2 my-2 my-lg-0"
            style={{ maxHeight: '200px' }}
            navbarScroll
          >
            <NavLink to="/" className="nav-link">Home</NavLink>
            <NavLink to="/Components/About" className="nav-link">About</NavLink>
            <NavLink to="/Components/Contact" className="nav-link">Contact</NavLink>
          </Nav>

          <Form className="d-flex">
            <Form.Control
              name="query"
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success" className='searchbtn'>Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
